import React from 'react';
import ProjectBuilder from './projectBuilder'
import SideMenu from './sideMenu'
import AllProjects from './allProjects'
import { BrowserRouter as Router, Switch, Route, Redirect, match } from "react-router-dom";

export default class Dashboard extends React.Component {

  constructor(props) {
    super(props)
    this.user = props.user
    this.firebase = props.firebase
    this.state = {
      data: {}
    }
  }

  loadData() {
    let dashboard = this;
    this.firebase.get_user_data(this.user, function (data) {
      dashboard.setState({ data: data })
    })
  }

  componentDidMount() {
    this.loadData()
  }

  render() {
    return (
      <div>
        <SideMenu
          firebase={this.firebase}
        />
        <Router>
          <Switch>
            <Route path={`${match.path}/new_project`}>
              <ProjectBuilder user={this.user} firebase={this.firebase} />
            </Route>
          </Switch>
        </Router>
      </div>
    );
  }
}
